import React from "react";

export default function Footer() {
  const year = new Date().getFullYear();

  return (
    <footer className="footer">
      <h2>Wand Shop | E-Commerce Project</h2>
      <p>
        &copy; <span>{year}</span> WandShop.com - All Rights Copyright
        Reserved To{" "}
        <a
          target="_blank"
          rel="noreferrer"
          href="https://www.linkedin.com/in/sneha-qb/"
        >
          Sneha Biswas
        </a>
      </p>
    </footer>
  );
}
